import React, {useState} from 'react'
import Title from './Title'

export default function Ready(props) {

  return (
    <div>
        <Title text = {"Ready?"}/>
        <button onClick={()=>props.goToTraningPage()}>Yes</button>
        <button onClick={()=>props.changePage("login")}>No</button>
    </div>
  )
}
